import './app.scss';
import { Row, Container, Col } from "react-bootstrap";
import personal_photo from "./assets/personal_image.png";
import git_logo from "./assets/git_logo.png";
import linkedin_logo from "./assets/linkedin-logo.png";
import greads_logo from "./assets/greads-logo.png";
import spotify_logo from "./assets/spotify_logo.png";
import React from "react";
import reactDom from 'react-dom';

const icons = [
	{
		icon_image: git_logo,
		url: "https://github.com/luismomm2110",
		description: "github"
	},
	{
		icon_image: linkedin_logo,
		url: "https://www.linkedin.com/in/luis-antonio-momm-duarte-25224915a/",
		description: "linkedin"
	},
	{
		icon_image: spotify_logo, 
		url: "https://open.spotify.com/user/luismomm",
		description: "spotfy"
	},
	{
		icon_image: greads_logo, 
		url: "https://www.goodreads.com/user/show/64864252-luis-antonio-momm-duarte",
		description: "goodreads"
	} 
];

function Intro() { 
	return (
		<React.Fragment>
			<div style={{"fontSize" : "100%", "display" : "flex"}}>
				Luis Antonio Momm Duarte 
			    <p style={{"flexGrow" : "1", "fontSize" : "80%"}}> 
					      luismomm@gmail.com
				</p>
			</div>
			<hr className="horizontal-line"></hr>
			<p className="main-text"> 
				Hello! I'm a tech professional, interested about web development, data, functional programming,
				operating systems and many other fields . 
			</p> 
			<p className="main-text"> 
				My current job is at Softexpert, a brazilian company market leader in software for bussiness compliance, 
				where I work mainly with data integration (ETL) using pandas and producing SQL Scripts for customers' BI 
			</p>
		</React.Fragment>
	)
}

function Education() {
	return (
		<React.Fragment>
			<h4 className="header" style={{"fontSize" : "90%"}}>Education</h4>
			<hr className="horizontal-line"></hr>
			<p className="main-text"> 
				As an advocate of self-education as a path to progress in the 21st century,
				 I follow the OSSU  (Open Source Society University) curriculum for most of my technology education.
			</p>
			<h5 className="header" style={{"fontSize" : "00%"}}>Selected Projects</h5>
			<hr className="horizontal-line"></hr>
		</React.Fragment>
	)
}

function Photo() {
    return (
        <React.Fragment>
            <div className={"photo-box"}>
				<img className={"personal-photo"} alt="Hello, I'm Luis" src={personal_photo}></img>
            </div>
        </React.Fragment>
    )
}

function Icons({icons}) {
	return (
		<React.Fragment>
			{icons.map((icon) => (
				<a href={icon.url}><img className={"icon-image"} src={icon.icon_image} alt={icon.description} ></img></a>
			))
			}
			<br></br>
		</React.Fragment>
	)
}

function App() {
  return (
<Container className={"container-main"} fluid>  
			<Row> 
				<Col className={"side-box"} lg={3} xs={1}>
				</Col>
				<Col className={"center-box"} lg={6} xs={10}>
					<Photo />
					<Icons className={"icon-row"} icons={icons} />
					<Intro />
					<Education />
				</ Col> 
				<Col className={"side-box"} lg={3} xs={1}>
				</Col>
		</Row>
	</Container>
  );
}

export default App;
